(3, 'Projet collectif 2', 'Le Guide des procres d\'luation sanitaire (GPES) a concomme un compagnon de terrain de Actions Speak: the study of hygiene behaviour in mater and sanitation projects (Boot and Cairncross, 1993), ouvrage de rrence prr l\'intention des chefs de projet et des dsionnaires. Le GPES, pour sa part, traite essentiellement des probls pratiques rencontrsur le terrain en mati d\'approvisionnement d\'eau et d\'assainissement, et prnte les projets d\'cation sanitaire qui permettront au personnel sur le terrain d\'borer et de riser ses propres programmes d\'luation des pratiques d\'hygi.\r\nLe Guide des procres d\'luation sanitaire (GPES) a concomme un compagnon de terrain de Actions Speak: the study of hygiene behaviour in mater and sanitation projects (Boot and Cairncross, 1993), ouvrage de rrence prr l\'intention des chefs de projet et des dsionnaires. Le GPES, pour sa part, traite essentiellement des probls pratiques rencontrsur le terrain en mati d\'approvisionnement d\'eau et d\'assainissement, et prnte les projets d\'cation sanitaire qui permettront au personnel sur le terrain d\'borer et de riser ses propres programmes d\'luation des pratiques d\'hygi.\r\nLe Guide des procres d\'luation sanitaire (GPES) a concomme un compagnon de terrain de Actions Speak: the study of hygiene behaviour in mater and sanitation projects (Boot and Cairncross, 1993), ouvrage de rrence prr l\'intention des chefs de projet et des dsionnaires. Le GPES, pour sa part, traite essentiellement des probls pratiques rencontrsur le terrain en mati d\'approvisionnement d\'eau et d\'assainissement, et prnte les projets d\'cation sanitaire qui permettront au personnel sur le terrain d\'borer et de riser ses propres programmes d\'luation des pratiques d\'hygi.\r\nLe Guide des procres d\'luation sanitaire (GPES) a concomme un compagnon de terrain de Actions Speak: the study of hygiene behaviour in mater and sanitation projects (Boot and Cairncross, 1993), ouvrage de rrence prr l\'i